 резервном копировании. Направьте ваши запланированные резервные копии для хранения в Dropbox. Это безопасно, просто и позволяет иметь ваши резервные копии под рукой.','Tailor your backup schedules to fit the complexity of your WordPress Multisite. Choose to export the entire network or only a selection of subsites according to your requirements. Effortless management for even the most intricate site networks.'=>'Адаптируйте расписание резервного копирования в соответствии со сложностью вашего мультисайта WordPress. Выберите экспорт всей сети или только нескольких дочерних сайтов в соответствии с вашими требованиями. Простое управление даже самыми сложными сетями сайтов.','We\'ve got you covered with an array of supported storage providers. Whether you prefer Box, Amazon S3, WebDav or something else, you can choose the one that fits your needs best. Secure your backups exactly where you want them.'=>'Мы предоставили вам широкий спектр поддерживаемых провайдеров систем хранения данных. Независимо от того, предпочитаете ли вы Box, Amazon S3, WebDAV или что-то еще, вы можете выбрать то, что лучше всего соответствует вашим потребностям. Сохраните свои резервные копии именно там, где вы хотите.','Enjoy the flexibility of FTP storage. Direct your scheduled backups to your own FTP server. You\'ll have full control over your data, providing you with a versatile and private storage solution.'=>'Наслаждайтесь гибкостью FTP-хранилища. Отправляйте запланированные резервные копии на свой собственный FTP-сервер. Вы будете иметь полный контроль над своими данными, предоставляя универсальное и приватное решение для хранения.','Harness the power of OneDrive for your backups. Set up your scheduled backups to be saved directly in your OneDrive. It\'s secure, integrated with your Microsoft account, and keeps your data readily accessible.'=>'Используйте возможности OneDrive для создания резервных копий. Настройте сохранение запланированных резервных копий непосредственно в OneDrive. Он безопасен, интегрирован с вашей учетной записью Майкрософт и обеспечивает легкий доступ к вашим данным.','Benefit from the robustness of Google Drive. Schedule your backups to be saved directly to your Google Drive account. Simple, secure, and integrated into a platform you already use.'=>'Извлеките выгоду из надежности Google Диска. Запланируйте сохранение резервных копий непосредственно в вашей учетной записи Google Drive. Простой, безопасный и интегрированный в платформу, которой вы уже пользуетесь.','Manage your storage effectively with our flexible retention settings. Decide how many backups you want to keep at a time. Old backups are automatically cleared, keeping your storage neat and efficient.'=>'Эффективно управляйте своим хранилищем с помощью наших гибких настроек хранения. Решите, сколько резервных копий вы хотите хранить одновременно. Старые резервные копии автоматически удаляются, сохраняя ваше хранилище аккуратным и эффективным.','Retention settings'=>'Настройки задержки','Stay informed, not overwhelmed. Tailor your notification preferences to get updates that matter to you. Whether it\'s the status of each backup, or just critical alerts, control what you want to be notified about.'=>'Будьте в курсе событий, не перегружайтесь. Настройте свои настройки уведомлений, чтобы получать важные для вас обновления. Будь то статус каждой резервной копии или просто важные оповещения, контролируйте, о чем вы хотите получать уведомления.','Notification settings'=>'Настройки уведомлений','Never worry about forgetting to back up your site again. Choose from various scheduling options, from daily to monthly, and we\'ll automate the rest. Backups happen like clockwork, giving you peace of mind and a solid safety net'=>'Никогда больше не беспокойтесь о том, что забудете создать резервную копию вашего сайта. Выбирайте из различных вариантов планирования, от ежедневного до ежемесячного, а остальное мы автоматизируем. Резервное копирование выполняется как по маслу, обеспе