ста плагин перед тем, как продолжить использовать его.','Your backup is from a PHP %s but the site that you are importing to is PHP %s. This could cause the import to fail. Technical details: https://help.servmask.com/knowledgebase/migrate-wordpress-from-php-5-to-php-7/'=>'Ваша резервная копия сделана с PHP %s, но сайт, на который вы импортируете, имеет PHP %s. Это может привести к сбою импорта. Технические подробности: https://help.servmask.com/knowledgebase/migrate-wordpress-from-php-5-to-php-7/','Refreshing backup list...'=>'Обновляем список резервных копий...','<h3>Site could not be imported</h3><p>Please make sure that storage directory <strong>%s</strong> has read and write permissions.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>Невозможно импортировать сайт</h3><p>Пожалуйста убедитесь, что папка "storage" <strong>%s</strong> имеет корректные файловые разрешения.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Технические детали</a></p>','<h3>Site could not be exported</h3><p>Please make sure that storage directory <strong>%s</strong> has read and write permissions.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>Невозможно экспортировать сайт</h3><p>Пожалуйста убедитесь, что папка "storage"  <strong>%s</strong> имеет корректные файловые разрешения.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Технические детали</a></p>','<h3>Site could not be restored</h3><p>Please make sure that storage directory <strong>%s</strong> has read and write permissions.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>Сайт не можеть быть восстановлен</h3><p>Пожалуйста убедитесь, что папка "storage" <strong>%s</strong> имеет коррект