 for this backup'=>'Нажмите чтобы установить подпись для этой резервной копии','<a href="%s" class="ai1wm-button-green ai1wm-emphasize ai1wm-button-download" title="%s" download="%s"><span>Download %s</span><em>Size: %s</em></a>'=>'<a href="%s" class="ai1wm-button-green ai1wm-emphasize ai1wm-button-download" title="%s" download="%s"><span>Загрузить %s</span><em>Размер: %s</em></a>','Unable to export: %s'=>'Невозможно экспортировать: %s','Unable to import: %s'=>'Невозможно импортировать: %s','Unable to import. Error code: %s. %s'=>'Невозможно импортировать. Код ошибки: %s. %s','The import process will overwrite your website including the database, media, plugins, and themes. Are you sure to proceed?'=>'Процесс импорта перезапишет ваш веб-сайт включая базу данных, медиа файлы, плагины и темы. Вы уверены, что хотите продолжить?','Please make sure that your file was exported using <strong>All-in-One WP Migration</strong> plugin. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">Technical details</a>'=>'Пожалуйста, убедитесь, что ваш файл был экспортирован с помощью <strong>Все-в-одном WP Миграция</strong> плагин. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">Технические детали</a>','The archive file is corrupted. Follow <a href="https://help.servmask.com/knowledgebase/corrupted-archive/" target="_blank">this article</a> to resolve the problem.'=>'Файл архива поврежден. следить<a href="https://help.servmask.com/knowledgebase/corrupted-archive/" target="_blank">Эта статья</a> решить проблему.','Your PHP is 32-bit. In order to import your file, please change your PHP version to 64-bit and try again. <a href="https://help.servmask.com/knowledgebase/php-32bit/" target="_blank">Technical details</a>'=>'Ваш PHP 32-битный. Чтобы импортировать файл, измените версию PHP на 64-битную и повторите попытку.<a href="https://help.servmask.com/knowledgebase/php-32bit/" target="_blank">Технические детали</a>','