gebase/invalid-backup-file/" target="_blank">Technical details</a>'=>'Тип файла, который вы пытались загрузить, не совместим с этим плагином. Пожалуйста, убедитесь, что ваш файл<strong>.wpress</strong> файл, созданный с помощью модуля миграции All-in-One WP. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">Технические детали</a>','WordPress Multisite is supported via our All-in-One WP Migration Multisite Extension. You can get a copy of it here'=>'WordPress Multisite поддерживается через наше расширение  All-in-One WP Migration Multisite. Вы можете получить копию здесь','All-in-One WP Migration is not able to create <strong>%s</strong> file. Try to change permissions of the parent folder or send us an email at <a href="mailto:support@servmask.com">support@servmask.com</a> for assistance.'=>'All in One WP Migration не может создать<strong>%s</strong>файл. Попробуйте изменить разрешения родительской папки или отправьте нам письмо по адресу<a href="mailto:support@servmask.com">support@servmask.com</a> для оказания помощи.','All-in-One WP Migration is not able to create <strong>%s</strong> folder. You will need to create this folder and grant it read/write/execute permissions (0777) for the All-in-One WP Migration plugin to function properly.'=>'All in One WP Migration не может создать <strong>%s</strong>папку. Вам нужно будет создать эту папку и предоставить ей разрешения на чтение / запись / выполнение (0777), чтобы плагин All in One WP Migration работал правильно.','or'=>'или','How-to: Increase maximum upload file size'=>'Как увеличить максимальный размер загружаемых файлов','Maximum upload file size: <strong>%s</strong>.'=>'Максимальный размер загружаемых файлов: <strong>%s</strong>','The file is too large for this server.'=>'Файл слишком большой для этого сервера.','<a href="https://help.servmask.com/2018/10/27/how-to-increase-maximum-upload-file-size-in-wordpress/" target="_blank">How-to: Increase maximum upload file size</a> 